#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAX_SONGS 100 // maksimum jumlah lagu dalam playlist

// Struktur data untuk menyimpan informasi mengenai sebuah lagu
typedef struct {
  char title[100]; // judul lagu
  char artist[50]; // nama penyanyi/band
  int duration;    // durasi lagu (dalam detik)
} Song;

// Struktur data untuk menyimpan playlist
typedef struct {
  Song songs [MAX_SONGS]; // daftar lagu dalam playlist
  int front, rear;       // indeks elemen pertama dan terakhir dalam playlist
  int size;              // jumlah lagu dalam playlist
} Playlist;

// Inisialisasi playlist
void init(Playlist *playlist) {
  playlist->front = 0;
  playlist->rear = -1;
  playlist->size = 0;
}

void enqueue(Playlist *playlist, Song song);
void dequeue(Playlist *playlist);
void shuffle(Playlist *playlist);
void play(Playlist *playlist);
void display(Playlist *playlist);
void save(Playlist *playlist);
void load(Playlist *playlist);

//Fungsi utama (main)
int main() {
  Playlist playlist;
  init(&playlist);

  while (1) {
    printf(" \n");
    printf("Pilih menu:\n");
    printf("1. Tambah lagu\n");
    printf("2. Hapus lagu\n");
    printf("3. Tampilkan playlist\n");
    printf("4. Simpan playlist ke file\n");
    printf("5. Muat playlist dari file\n");
    printf("6. Putar lagu\n");
    printf("7. Skip lagu\n");
    printf("8. Acak playlist\n");
    printf("9. Keluar\n");
    printf("Pilihanmu: ");

    int menu;
    scanf("%d", &menu);

    switch (menu) {
      case 1: {
        // Meminta informasi mengenai lagu yang akan ditambahkan
        // kemudian menambahkannya ke playlist
        char title[100];
        char artist[50];
        int duration;

        getchar();
        printf("Masukkan judul lagu: ");
        fgets(title, sizeof(title), stdin);
        printf("Masukkan nama penyanyi/band: ");
        fgets(artist, sizeof(artist), stdin);
        printf("Masukkan durasi lagu (dalam detik): ");
        scanf("%d", &duration);

        Song song;
        strcpy(song.title, title);
        strcpy(song.artist, artist);
        song.duration = duration;
        enqueue(&playlist, song);

        break;
      }
      case 2: {
        // Menghapus lagu pertama dari playlist
        dequeue(&playlist);
        break;
      }
      case 3: {
        // Menampilkan informasi mengenai seluruh lagu dalam playlist
        display(&playlist);
        break;
      }
      case 4: {
        // Menyimpan playlist ke file Songs.bin
        save(&playlist);
        break;
      }
      case 5: {
        // Memuat playlist dari file Songs.bin
        load(&playlist);
        break;
      }
      case 6: {
        // Memutar lagu dari playlist
        play(&playlist);
        break;  
      }
      case 7: {
        // Mengacak urutan lagu dalam playlist
        shuffle(&playlist);
        break;
      }
      case 8: {
        // Keluar dari program
        printf("Terima kasih telah menggunakan program ini!\n");
        return 0;
      }
      default: {
        // Default case 
        printf("Menu tidak valid!\n");
        break;
      }
    }
  }

  return 0;
}

// Menambahkan sebuah lagu ke playlist
void enqueue(Playlist *playlist, Song song) {
  if (playlist->size == MAX_SONGS) {
    printf("Playlist sudah penuh!\n");
    return;
  }

  playlist->rear = (playlist->rear + 1) % MAX_SONGS;
  playlist->songs[playlist->rear] = song;
  playlist->size++;
  printf("Lagu telah ditambahkan ke playlist.\n");
}

// Menghapus sebuah lagu dari playlist
void dequeue(Playlist *playlist) {
  if (playlist->size == 0) {
    printf("Playlist sudah kosong!\n");
    return;
  }

  playlist->front = (playlist->front + 1) % MAX_SONGS;
  playlist->size--;
  printf("Lagu telah dihapus dari playlist.\n");
}

// Memutar sebuah lagu dari playlist
void play(Playlist *playlist) {
  if (playlist->size == 0) {
  printf("Playlist kosong.\n");
  } 
  else {
  printf("Memutar lagu %s oleh %s\n", playlist->songs[playlist->front].title, playlist->songs[playlist->front].artist);
  }
}

// Mengacak urutan lagu dalam playlist
void shuffle(Playlist *playlist) {
  for (int i = 0; i < playlist->size; i++) {
    int j = rand() % playlist->size;
    Song temp = playlist->songs[i];
    playlist->songs[i] = playlist->songs[j];
    playlist->songs[j] = temp;
  }
  printf("Lagu telah diacak.\n");
}

// Menampilkan informasi mengenai seluruh lagu dalam playlist
void display(Playlist *playlist) {
  if (playlist->size == 0) {
    printf("Playlist kosong!\n");
    return;
  }

  printf("Daftar lagu dalam playlist:\n");
  for (int i = 0; i < playlist->size; i++) {
    int index = (playlist->front + i) % MAX_SONGS;
    printf("- %s - %s [%d detik]\n",
           playlist->songs[index].title,
           playlist->songs[index].artist,
           playlist->songs[index].duration);
  }
}

// Menyimpan playlist ke file eksternal
void save(Playlist *playlist) {
  FILE *file = fopen("Songs.bin", "wb");

  if (file == NULL) {
    printf("Gagal menyimpan playlist ke file!\n");
    return;
  }

  for (int i = 0; i < playlist->size; i++) {
    int index = (playlist->front + i) % MAX_SONGS;
    fprintf(file, "%s %s %d\n",
            playlist->songs[index].title,
            playlist->songs[index].artist,
            playlist->songs[index].duration);
  }

  fclose(file);
  printf("Playlist berhasil disimpan ke file!\n");
}

// Memuat playlist dari file eksternal
void load(Playlist *playlist) {
  FILE *file = fopen("Songs.bin", "rb");
  if (file == NULL) {
    printf("Gagal memuat playlist dari file!\n");
    return;
  }

  char title[100];
  char artist[50];
  int duration;
  Song song;

  // Memuat informasi mengenai lagu dari file
  // dan menambahkannya ke playlist
  while (fscanf(file, "%s %s %d", title, artist, &duration) == 3) {
    strcpy(song.title, title);
    strcpy(song.artist, artist);
    song.duration = duration;

    enqueue(playlist, song);
  }

  fclose(file);
  printf("Playlist berhasil dimuat dari file!\n");
}

