        in >> x[i] >> y[i];
    }
    //Calculate the matrix
    double matrix[m1][n1];
    for (int i = 0; i < m1; i++) {
        for (int j = 0; j < n1; j++) {
            double sum = 0;
            for (int k = 0; k < n; k++)
                sum += pow(x[k], j + i);
            matrix[i][j] = sum;
        }
    }
    //Calculate the vector
    double vector[m1];
    for (int i = 0; i < m1; i++) {
        double sum = 0;
        for (int j = 0; j < n; j++)
            sum += pow(x[j], i) * y[j];
        vector[i] = sum;
    }
    //Solve the equation
    double a[m1];
    for (int i = 0; i < m1; i++)
        a[i] = 0;
    gaus(matrix, vector, a, m1);
    //Print out the result
    out << fixed << setprecision(2);
    out << "The polynomial regression equation is:" << endl;
    out << "y = " << a[0];
    for (int i = 1; i < m1; i++)
        out << " + " << a[i] << "x^" << i;
    out << endl;
    //Close the files
    in.close();
    out.close();
    return 0;
}

//The Gaus method
void gaus(double a[maxSize][maxSize], double b[maxSize], double x[maxSize], int n) {
    int i, j, k;
    double m;
    for (k = 0; k < n - 1; k++) {
        for (i = k + 1; i < n; i++) {
            m = a[i][k] / a[k][k];
            for (j = k + 1; j < n; j++)
                a[i][j] = a[i][j] - m * a[k][j];
            b[i] = b[i] - m * b[k];
        }
    }
    x[n - 1] = b[n - 1] / a[n - 1][n - 1];
    for (k = n - 2; k >= 0; k--) {
        x[k] = b[k];
        for (j = k + 1; j < n; j++)
            x[k] = x[k] - a[k][j] * x[j];
        x[k] = x[k] / a[k][k];
    }
}

