// Repository interface
type Repository interface {
    Get(id int) (interface{}, error)
    Create(data interface{}) error
    Update(id int, data interface{}) error
    Delete(id int) error
}

// Goroutine Channel
func GoroutineChannel(r Repository, data interface{}) {
    channel := make(chan bool)
    go func() {
        err := r.Create(data)
        if err != nil {
            channel <- false
        } else {
            channel <- true
        }
    }()

    result := <-channel
    if result {
        fmt.Println("Data insert successful")
    } else {
        fmt.Println("Data insert failed")
    }
}

