// Channel goroutine
package main

import (
	"fmt"
	"sync"
)

type user struct {
	name string
	age int
}

type Repository struct {
	users []user
	mux sync.Mutex
}

func (r *Repository) GetUser(name string) user {
	r.mux.Lock()
	defer r.mux.Unlock()

	for _, u := range r.users {
		if u.name == name {
			return u
		}
	}
	return user{}
}

func (r *Repository) AddUser(name string, age int) {
	r.mux.Lock()
	defer r.mux.Unlock()

	r.users = append(r.users, user{name: name, age: age})
}

func main() {
	repo := Repository{
		users: []user{},
	}

	// Membuat channel untuk menerima user
	userChan := make(chan user)

	// Menambahkan user
	go func() {
		for {
			select {
			case u := <-userChan:
				repo.AddUser(u.name, u.age)
				fmt.Printf("[INFO] Menambahkan user: %v\n", u)
			}
		}
	}()

	// Mendapatkan user
	go func() {
		u := repo.GetUser("Alice")
		fmt.Printf("[INFO] Mendapatkan user: %v\n", u)
	}()

	// Menambahkan user baru
	userChan <- user{name: "Bob", age: 18}

	// Menunggu semua Goroutine selesai
	var wg sync.WaitGroup
	wg.Add(2)
	wg.Wait()
}

