int factorial(int n) 
{ 
	int res = 1; 
	for (int i = 2; i <= n; i++) 
		res = res * i; 
	return res; 
} 

// Membuat fungsi untuk menghitung Fibonacci
int fibonacci(int n) 
{ 
	if (n <= 1) 
		return n; 
	return fibonacci(n-1) + fibonacci(n-2); 
} 

